import React from 'react'
import './styles.css'

export default function Navbar() {
  return (
    <div className="sidebar-mobile">
      <div className="menu-toggle">
        <div className="one"></div>
        <div className="two"></div>
        <div className="three"></div>
      </div>
    </div>
  )
}
